import React from "react";
import { Card } from "react-bootstrap";

export default function (props) {
  return (
    <Card
      bg={"warning"}
      text={"white"}
      style={{ width: "18rem", cursor: "pointer" }}
      className="mb-2"
    >
      <Card.Header>{props.title}Feature Title</Card.Header>
      <Card.Body>
        <Card.Text>Feature description 1.</Card.Text>
      </Card.Body>
    </Card>
  );
}
